1abc9c\", \"#3498db\", \"#2ecc71\",\n                        \"#9b59b6\", '#34495e', '#f1c40f','#e67e22', '#e74c3c', '#7f8c8d'];\n            // the model that triggered the callback is cb_obj:\n            var b = cb_obj.get(\"active\");\n            var rgbToHex = function(rgb){\n              var hex = Number(rgb).toString(16);\n              if (hex.length < 2) {\n                   hex = \"0\" + hex;\n              }\n              return hex;\n            };\n            var fullColorHex = function(r,g,b) {\n                var red = rgbToHex(r);\n                var green = rgbToHex(g);\n                var blue = rgbToHex(b);\n                return \"#\"+red+green+blue;\n            };\n            // models passed as args are automagically available\n            var data = source.data;\n            var len = data.color.length;\n            var col = [];\n            var othercol = '#1abc9c';\n            if(b === 1){ //Doublon\n                var j = 0;\n                for(i=0;i<len;++i){\n                    if(data.doub[i]){\n                        col.push(colors[j]);\n                        col[i-1] = colors[j];\n                        j++;\n                    }else{col.push(\"#999999\");}\n                }\n                source.data.color = col;\n            }\n            if(b ===2){ //Nans\n                var temp = 0\n                max = Math.max(...data.nans)\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * (1 - ((data.nans[i] + 1) / 19)));\n                    col.push(fullColorHex(temp, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b === 0) { //Cluster\n                var j = 0;\n                if(data.clusters){\n                    for(i=0;i<len;++i){col.push(colors[1+data.clusters[i]]);}\n                }else{\n                    for(i=0;i<len;++i){col.push(othercol);}\n                }\n                source.data.color = col;\n            }\n            if(b === 3) { //KaKs_Scores\n                max = Math.max(...data.KaKs_Scores)\n                for(i=0;i<len;++i){\n                    // normalizing\n                    temp =  Math.floor(255 * (1 - (data.KaKs_Scores[i] / max)));\n                    col.push(fullColorHex(temp,temp,76))\n                }\n                source.data.color = col;\n            }\n            if(b === 4){ //similarity_scores\n                max = Math.max(...data.similarity_scores)\n                min = Math.min(...data.similarity_scores)\n                console.log(min)\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * ((data.similarity_scores[i] - min) / (max-min)));\n                    col.push(fullColorHex(temp,temp,76))\n                }\n                data.color = col;\n            }\n            if(b === 5){ //Lengths\n                max = Math.max(...data.lengths)\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * (1 - (data.lengths[i] / max)));\n                    col.push(fullColorHex(temp, temp, temp));\n                }\n                data.color = col;\n            }\n            if(b===6){ //GC\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.gc[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===7){ //ECAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.ecai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===8){ //CAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.cai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            source.change.emit();\n            "},"id":"a834a9b6-2420-4a59-9ccc-db837e30c4ed","type":"CustomJS"},{"attributes":{"formatter":{"id":"ec1e4dac-e075-4b28-908d-f45808b063da","type":"BasicTickFormatter"},"plot":{"id":"f84bd720-3182-4f4f-96b7-93d6c443d4f5","subtype":"Figure","type":"Plot"},"ticker":{"id":"c602811d-defa-426d-bce6-c6bde9d8b59d","type":"BasicTicker"}},"id":"27733d4f-e0cc-47b8-bc96-3aaa474e7698","type":"LinearAxis"},{"attributes":{"callback":null,"tooltips":[["species","@species"],["nan_nb","@nans"],["mean_entr","@meanentropy"],["length","@lengths"],["GCcount","@gc"]]},"id":"be5ff8ba-e10d-4061-bf53-a215c8093484","type":"HoverTool"},{"attributes":{"plot":{"id":"f84bd720-3182-4f4f-96b7-93d6c443d4f5","subtype":"Figure","type":"Plot"},"ticker":{"id":"c602811d-defa-426d-bce6-c6bde9d8b59d","type":"BasicTicker"}},"id":"4090e003-14db-4d85-af15-5c60e5729f6f","type":"Grid"},{"attributes":{"children":[{"id":"43edd478-1104-4665-860d-e495f2a9d01d","type":"WidgetBox"},{"id":"f84bd720-3182-4f4f-96b7-93d6c443d4f5","subtype":"Figure","type":"Plot"}]},"id":"20371f2d-9e31-4685-8982-70fc1e7e2803","type":"Column"},{"attributes":{"dimension":1,"plot":{"id":"f84bd720-3182-4f4f-96b7-93d6c443d4f5","subtype":"Figure","type":"Plot"},"ticker":{"id":"0e0c9947-6a9f-40d3-8770-06eac376d39c","type":"BasicTicker"}},"id":"2143dd4d-1d12-42ad-9d06-02344710ee99","type":"Grid"}],"root_ids":["20371f2d-9e31-4685-8982-70fc1e7e2803"]},"title":"Bokeh Application","version":"0.12.10"}};
